<?php

namespace Drupal\wincachedrupal\Tests\Cache;

use Drupal\KernelTests\KernelTestBase;

use Drupal\wincachedrupal\Cache\WincacheBackendFactory;
use Drupal\wincachedrupal\Cache\WincacheRawBackendFactory;
use Drupal\supercache\Cache\DummyTagChecksum;


/**
 * Testea funciones basicas.
 *
 * @group Cache
 */
class MiscelaneaTests extends KernelTestBase {

  public function setUp() {
    parent::setUp();
  }

  protected function doSerialize($use_json, $data) {
    if ($use_json) {
      return json_encode($data);
    }
    else {
      return serialize($data);
    }
  }

  /**
   * Test for a bug in the Wincache extension
   * where using nested arrays with wincache_ucache_*
   * functions messes everything up.
   *
   * The test does not seem to make much sense,
   * except for that it did when the bug was there.
   *
   */
  public function testBugInWincacheExtension() {

    // If you use use_wincache = TRUE the script will behave unexpectedly.
    // Use FALSE to make the script work like a charm.
    $enable_wincache = TRUE;

    // If you use serialize() the script crashes.
    // If you use json_encode() it does not crash,
    // but still demonstrates the issue printing out: 'This is bad'

    $use_json = TRUE; // Set this to FALSE to make PHP crash.

    $data = '';
    $data = unserialize(base64_decode($data));
    $cid = 'cacheid';

    if ($enable_wincache) {
      wincache_ucache_set($cid, $data);
      $data = wincache_ucache_get($cid);
    }

    $definition = $data['core/core.services.yml'];

    foreach ($definition['services'] as $service) {
      if (!isset($service['tags'])) {
        continue;
      }
      $tagdef = $this->doSerialize($use_json, $service['tags']);
      foreach ($service['tags'] as $tag) {
        $name = $tag['name'];
        unset($tag['name']);
        $name = 'hola';
        $tagdef2 = $this->doSerialize($use_json, $service['tags']);
        $this->assertEquals($tagdef, $tagdef2);
        $this->assertEquals($name, 'hola');
      }
    }

    $this->pass("Everything OK.");
  }

  /**
   * @see https://forums.iis.net/t/1229315.aspx?Final+version+of+WinCache+2+0+for+PHP+7+0+0
   */
  function testBugInWincache2() {

    $frag1 = array('green' => 13, 'black' => 14);
    $bar1 = array('green' => 5, 'Blue' => '6', 'yellow', 'cyan' => 'eight');
    $bar2 = array('greenish' => 9, 'Blueish' => '10', 'yellowish', 'cyanish' => 'twelve', 'blackish' => $frag1);
    $bar3 = array('greenlike' => 9, 'pink' => 10, 'chartruce' => '11', 'brown', 'magenta' => 'thirteen');
    $master = array('first' => $bar1, 'second' => $bar2, 'third' => $bar3, 'fourth' => $bar1, 'fifth' => $bar2, '6th' => $bar2);


    $this->assertTrue(wincache_ucache_add('master', $master));
    $this->assertTrue(wincache_ucache_exists('master'));
    $this->assertEquals(count(wincache_ucache_get('master')), count($master));
  }

}